I have a CSS bug. The loading indicator container is narrower than the user message bubble above it - they should be the same width (90% of the container). Both use similar CSS rules but the loading indicator appears narrower. Please analyze the screenshot and CSS, and tell me the fix. The .loading class is at lines 660-675 and the .message class is at lines 529-536. The chat-container uses flexbox with align-items: flex-start (lines 1816-1828).

