```css
/* RDR2 Horse Advisor - Dark Frontier Theme */

/* Chinese Rocks font - RDR2 style */
@font-face {
    font-family: 'Chinese Rocks';
    font-style: normal;
    font-weight: 400;
    src: local('Chinese Rocks Rg'), url('https://fonts.cdnfonts.com/s/2754/chinese rocks rg.woff') format('woff');
}

* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

:root {
    /* Dark backgrounds */
    --bg-black: #0d0d0d;
    --bg-dark: #141414;
    --bg-card: #1a1a1a;
    --bg-elevated: #1e1e1e;

    /* Text */
    --text-cream: #e8e4dc;
    --text-light: #ffffff;
    --text-muted: #b8b2a5;
    --text-dark: #1a1a1a;

    /* Primary accent - gold/rust (RDR2 palette) */
    --gold: #c9a227;
    --rust: #b65a2a;
    --accent-primary: var(--gold);
    --accent-secondary: var(--rust);
    --accent-glow: rgba(201, 162, 39, 0.3);

    /* Red - used sparingly for alerts/important */
    --red-primary: #c41e3a;
    --red-dark: #8b1528;

    /* Borders */
    --border-subtle: #2a2a2a;
    --border-medium: #3a3a3a;
    --border-accent: #4a4539;

    /* Unified radius */
    --radius: 4px;

    /* Shadows - subtle, diegetic */
    --shadow-card: 0 2px 6px rgba(0, 0, 0, 0.45);
    --shadow-inset: inset 0 1px 2px rgba(0, 0, 0, 0.4);
    --shadow-plaque: inset 0 1px 0 rgba(255,255,255,0.08), 0 1px 2px rgba(0,0,0,0.4);
}

body {
