    background-image: radial-gradient(ellipse at center, var(--bg-dark) 0%, var(--bg-black) 100%);
}

.container {
    max-width: 900px;
    margin: 0 auto;
    padding: 20px;
    min-height: 100vh;
    display: flex;
    flex-direction: column;
}

/* ========== HEADER - Diegetic/Subtle ========== */
header {
    text-align: center;
    padding: 24px 20px 20px;
    margin-bottom: 12px;
    position: relative;
}

header h1 {
    font-family: 'Chinese Rocks', 'Rye', cursive;
    font-size: 2.4rem;
    color: #c12c3a;
    text-transform: uppercase;
    letter-spacing: 5px;
