    letter-spacing: 1px;
}

/* ========== AUTH UI ========== */
.header-top {
    display: block;
    text-align: center;
    margin-bottom: 6px;
}

.auth-container {
    position: fixed;
    top: 20px;
    right: 20px;
    display: flex;
    align-items: center;
    gap: 10px;
    z-index: 100;
}

.auth-btn {
    background: #171717;
    border: 1px solid #3a352b;
    color: var(--text-muted);
    padding: 8px 16px;
    border-radius: var(--radius);
    font-family: 'Crimson Text', serif;
    font-size: 0.78rem;
    letter-spacing: 0.5px;
