}

/* ========== NAV BUTTONS ========== */
.nav-buttons {
    margin-top: 12px;
    display: flex;
    gap: 8px;
    justify-content: center;
    flex-wrap: wrap;
}

.nav-btn {
    display: inline-block;
    padding: 8px 16px;
    text-decoration: none;
    border-radius: var(--radius);
    font-size: 0.85rem;
    font-family: 'Crimson Text', serif;
    letter-spacing: 0.5px;
    transition: all 0.2s ease;
    border: 1px solid var(--border-medium);
    background: transparent;
}

.nav-btn-primary {
    color: var(--accent-primary);
    border-color: var(--accent-primary);
}

.nav-btn-primary:hover {
    background: var(--accent-primary);
    color: var(--bg-black);
}

.nav-btn-secondary {
    color: var(--text-muted);
}

.nav-btn-secondary:hover {
    color: var(--text-cream);
    border-color: var(--text-muted);
}

/* ========== GAME-LIKE SECTION SELECTOR ========== */
.section-nav {
    display: flex;
    flex-direction: column;
    align-items: center;
    padding: 30px 20px;
    margin-top: 28px;
    margin-bottom: 20px;
    background: linear-gradient(180deg, rgba(10,10,10,0) 0%, rgba(15,15,15,0.9) 50%, rgba(10,10,10,0) 100%);
}

.section-nav-inner {
    position: relative;
    display: flex;
    flex-direction: column;
    align-items: flex-start;
    gap: 10px;
    padding: 12px 26px;
    border: 1px solid rgba(74,69,57,0.65);
    background: linear-gradient(180deg, rgba(18,18,18,0.95), rgba(12,12,12,0.95));
    background-image: radial-gradient(rgba(255,255,255,0.03) 1px, transparent 1px);
    background-size: 3px 3px;
    background-blend-mode: overlay;
    box-shadow:
        inset 0 1px 0 rgba(255,255,255,0.05),
        inset 0 -1px 0 rgba(0,0,0,0.7),
        inset 0 0 24px rgba(0,0,0,0.65),
        0 8px 24px rgba(0,0,0,0.55);
}

/* Inner rule lines for menu framing */
.section-nav-inner::before,
.section-nav-inner::after {
    content: '';
    display: block;
    width: 100%;
    height: 1px;
    background: linear-gradient(90deg, transparent, #4a4539, transparent);
}

.section-nav-inner::before { margin-bottom: 8px; }
.section-nav-inner::after  { margin-top: 8px; }

.section-nav-item {
    display: flex;
    align-items: center;
    gap: 16px;
    text-decoration: none;
    padding: 10px 20px 10px 50px;
    position: relative;
    transition: all 0.2s ease;
}

/* Cattleman revolver pointer (RDR2 style) */
.section-nav-item::before {
    content: '';
    position: absolute;
    left: 6px;
    top: 50%;
