.section-nav-item:hover::before,
.section-nav-item.active::before {
    opacity: 1;
}

.section-nav-item:hover::before {
    transform: translateY(-50%) translateX(2px);
}

.section-nav-item .section-text {
    font-family: 'Chinese Rocks', 'Rye', cursive;
    font-size: 1.5rem;
    font-weight: 600;
    color: #c2b8a6;
    letter-spacing: 2px;
    text-transform: uppercase;
    transition: all 0.2s ease;
}

.section-nav-item:hover .section-text {
    color: var(--text-cream);
}

/* Hover/active underline cue */
.section-nav-item:hover .section-text::after,
.section-nav-item.active .section-text::after {
    content: '';
    display: block;
    width: 26px;
    height: 2px;
    background: var(--gold);
    margin-top: 6px;
}

.section-nav-item.active .section-text {
    color: var(--gold);
    text-shadow: 0 0 12px rgba(201, 162, 39, 0.25);
}

/* Hide the bullet pointer - using left rule instead */
.section-nav-item .revolver-pointer {
    display: none;
}

/* Subtle line decorations */
.section-nav::before,
.section-nav::after {
    content: '';
    width: 200px;
    height: 1px;
    background: linear-gradient(90deg, transparent, var(--border-medium), transparent);
}

.section-nav::before {
    margin-bottom: 20px;
}

.section-nav::after {
    margin-top: 20px;
}

/* Mobile adjustments */
@media (max-width: 600px) {
    .section-nav-item .section-text {
        font-size: 1.3rem;
        letter-spacing: 1px;
    }

    .section-nav-item {
        padding-left: 36px;
    }

    .section-nav-inner {
        padding: 12px 20px;
    }
}

/* ========== CARDS & PANELS ========== */
.question-card,
.result-card,
.your-answers {
    background: var(--bg-card);
    border: 1px solid var(--border-subtle);
    border-radius: 4px;
    margin-bottom: 20px;
}

/* ========== MAIN CHAT AREA ========== */
main {
    flex: 1;
    display: flex;
    flex-direction: column;
}

.chat-container {
    flex: 1;
    overflow-y: auto;
    padding: 20px 0;
    min-height: 400px;
}

.welcome-message {
    text-align: center;
    padding: 18px 20px 30px;
}

.welcome-message h2 {
    font-family: 'Rye', cursive;
    color: var(--text-cream);
    margin-bottom: 8px;
    font-size: 1.4rem;
    font-weight: normal;
}

.welcome-message h3 {
    font-family: 'Rye', cursive;
    color: var(--text-muted);
    margin: 25px 0 15px;
    font-size: 1rem;
    font-weight: normal;
}

.welcome-hint {
    color: var(--text-muted);
    font-style: italic;
    font-size: 1rem;
}

.example-queries {
    list-style: none;
    margin-top: 10px;
    display: grid;
    gap: 10px;
    max-width: 600px;
    margin-left: auto;
    margin-right: auto;
}

.example-queries li {
    background: #171717;
    padding: 14px 22px;
    border-radius: var(--radius);
    cursor: pointer;
    transition: all 0.2s ease;
    border: 1px solid var(--border-subtle);
    color: var(--text-muted);
    font-style: normal;
}

.example-queries li:hover {
    border-color: var(--accent-primary);
    color: var(--text-cream);
    background: #1c1c1c;
}

/* ========== MESSAGES ========== */
.message {
    padding: 18px 22px;
    margin: 12px 0;
    border-radius: 4px;
    width: 90%;
    max-width: 90%;
    box-sizing: border-box;
}

.message.user {
    background: #2a1a1a;
    color: var(--text-cream);
    margin-left: auto;
    border: 1px solid var(--border-medium);
}

.message.assistant {
    background: var(--bg-card);
    border: 1px solid var(--border-subtle);
    font-size: 1rem;
    line-height: 1.8;
}

.message.assistant h3,
.message.assistant h4 {
    font-family: 'Rye', cursive;
    color: var(--accent-primary);
    margin-bottom: 12px;
    font-size: 1rem;
    font-weight: 600;
    letter-spacing: 1.5px;
}

.message.assistant ul {
    margin: 12px 0;
    padding-left: 25px;
}

.message.assistant li {
    margin: 6px 0;
}

.message.assistant strong {
    color: var(--accent-primary);
}

.message.assistant code {
    background: var(--bg-dark);
    padding: 2px 8px;
    border-radius: 3px;
    font-size: 0.9em;
    border: 1px solid var(--border-subtle);
}

.message.error {
    background: var(--red-dark);
    color: var(--text-cream);
    border: 1px solid var(--red-primary);
}

.message.error-message {
    background: rgba(139, 69, 19, 0.2);
    border: 1px solid var(--rust);
    color: var(--text-cream);
}

/* ========== HORSE CARDS ========== */

/* Hide bullets for list items containing cards */
li:has(.horse-card),
li:has(.horse-card-with-image),
li:has(.saddle-card),
li:has(.stirrups-card) {
    list-style: none;
    margin-left: 0;
    padding-left: 0;
}

.horse-card {
    background: var(--bg-elevated);
    border: 1px solid var(--border-subtle);
    border-radius: 4px;
    padding: 18px;
    margin: 12px 0;
}

.horse-card h4 {
    font-family: 'Rye', cursive;
    color: var(--rust);
    margin-bottom: 12px;
}

.horse-stats {
    display: grid;
    grid-template-columns: repeat(4, 1fr);
    gap: 12px;
    margin: 12px 0;
}

.stat {
    text-align: center;
}

.stat-label {
    font-size: 0.75rem;
    color: var(--text-muted);
    text-transform: uppercase;
    letter-spacing: 1px;
}

.stat-value {
    font-size: 1.3rem;
    font-weight: bold;
    color: var(--red-primary);
    font-family: 'Rye', cursive;
}

.stat-bar {
    height: 4px;
    background: var(--bg-dark);
    border-radius: 2px;
    margin-top: 6px;
    overflow: hidden;
}

.stat-bar-fill {
    height: 100%;
    background: linear-gradient(90deg, var(--red-dark), var(--red-primary));
    border-radius: 2px;
}

/* ========== LOADING ========== */
.loading {
    display: flex;
    align-items: center;
    gap: 12px;
    padding: 18px 22px;
    background: var(--bg-card);
    border: 1px solid var(--border-subtle);
    border-radius: 4px;
    margin: 12px 0;
    color: var(--text-muted);
    width: 90%;
    min-width: 90%;
    max-width: 90%;
    box-sizing: border-box;
}

.loading-dots {
    display: flex;
    gap: 6px;
}

.loading-dots span {
    width: 8px;
    height: 8px;
    background: var(--red-primary);
    border-radius: 50%;
    animation: bounce 1.4s infinite ease-in-out;
}

.loading-dots span:nth-child(1) { animation-delay: -0.32s; }
.loading-dots span:nth-child(2) { animation-delay: -0.16s; }

@keyframes bounce {
    0%, 80%, 100% { transform: scale(0); }
    40% { transform: scale(1); }
}

/* ========== INPUT AREA ========== */
.input-container {
    display: flex;
    align-items: stretch;
    gap: 12px;
    padding: 25px 0;
    border-top: 1px solid var(--border-subtle);
}

#queryInput {
    flex: 1;
    padding: 15px 18px;
    background: var(--bg-card);
    border: 2px solid var(--border-medium);
    border-radius: 8px;
    color: var(--text-cream);
    font-size: 1.1rem;
    resize: none;
    font-family: 'Crimson Text', Georgia, serif;
    transition: all 0.25s ease;
    min-height: 54px;
    box-shadow: inset 0 2px 4px rgba(0, 0, 0, 0.2);
}

#queryInput:focus {
    outline: none;
    border-color: var(--red-primary);
    box-shadow: inset 0 2px 4px rgba(0, 0, 0, 0.2), 0 0 0 3px rgba(196, 30, 58, 0.15);
}

#queryInput::placeholder {
    color: var(--text-muted);
    font-style: italic;
}

#sendBtn {
    width: 54px;
    min-height: 54px;
    background: var(--accent-primary);
    border: 1px solid var(--accent-primary);
    border-radius: var(--radius);
    cursor: pointer;
    display: flex;
    align-items: center;
    justify-content: center;
    transition: all 0.2s ease;
    flex-shrink: 0;
}

#sendBtn:hover {
    background: #d4b042;
    border-color: #d4b042;
}

#sendBtn:disabled {
    background: var(--bg-elevated);
    border-color: var(--border-medium);
    cursor: not-allowed;
    box-shadow: none;
    transform: none;
}

#sendBtn svg {
    width: 22px;
    height: 22px;
    color: var(--text-cream);
}

#newChatBtn {
    width: 52px;
    min-height: 52px;
    background: var(--bg-elevated);
    border: 1px solid var(--border-medium);
    border-radius: 4px;
    cursor: pointer;
    display: flex;
    align-items: center;
    justify-content: center;
    transition: all 0.2s;
    flex-shrink: 0;
}

#newChatBtn:hover {
    background: var(--bg-card);
    border-color: var(--rust);
}

#newChatBtn svg {
    width: 22px;
    height: 22px;
    color: var(--text-muted);
}

#newChatBtn:hover svg {
    color: var(--rust);
}

/* ========== FOOTER ========== */
footer {
    text-align: center;
    padding: 20px;
    color: var(--text-muted);
    font-size: 0.85rem;
    font-style: italic;
    border-top: 1px solid var(--border-subtle);
}

/* ========== MARKDOWN FORMATTING ========== */
.message.assistant p {
    margin: 12px 0;
    line-height: 1.6;
}

.message.assistant h2 {
    font-family: 'Rye', cursive;
    color: var(--accent-primary);
    font-size: 1.2rem;
    margin: 20px 0 12px 0;
    letter-spacing: 2px;
}

.message.assistant h3 {
    font-family: 'Rye', cursive;
    color: var(--text-cream);
    font-size: 1.15rem;
    margin: 20px 0 12px 0;
    padding: 10px 14px;
    background: var(--bg-elevated);
    border-left: 4px solid var(--red-primary);
    border-radius: 0 4px 4px 0;
}

.message.assistant h4 {
    font-family: 'Rye', cursive;
    color: var(--rust);
    font-size: 1rem;
    margin: 16px 0 8px 0;
