The width mismatch is coming from flex sizing. `.chat-container` is a flex column with `align-items: flex-start`, so each child is sized by its *flex basis*. For `.loading` (a flex container itself), the browser is shrinking it to its content even though you set `width: 90%`. The `.message` block appears wider because its text forces a larger intrinsic size.

**Fix:** force the loading items flex basis to 90% (same as message) and remove the conflicting min/max width.  

