  width: 90%;
  max-width: 90%;
}
```

This pins both to the same width regardless of content size.

If `.loading` still renders narrower, the **most likely cause** is that its **not a direct child of `.chat-container`**, so its `width: 90%` is being calculated against a *smaller parent*. The user `.message` elements *are* direct children, so their width is based on the full chat container.  

Check your DOM  if loading is wrapped (e.g. `<div class="assistant-message"><div class="loading"></div></div>` or inside a `<li>`), that wrapper is collapsing to content width because the container is a flex column with `align-items:flex-start`.

### Fix (best option)
Make the wrapper the 90% width, and let `.loading` fill it:

```css
