.chat-container > .loading-wrapper {
  width: 90%;
  max-width: 90%;
  align-self: flex-start;
}

.chat-container > .loading-wrapper .loading {
  width: 100%;
  max-width: 100%;
}
```

### Alternative: make `.loading` a direct sibling like `.message`
If possible, render loading the same way as messages:

```html
