```

Then you can drop duplicate width rules entirely and reuse `.message` sizing.

### Quick diagnostic
If DevTools shows `.loading`s computed width **exactly 90% of a smaller parent**, thats the issue. The parent needs the 90% width, not the child.

Yes  the mismatch is because **`.loading` has a flex-basis of 90% and `.message` does not**, and in a flex column the flex-basis wins over width. So they are no longer being sized by the same rule.

**Best unified fix:** give both the same sizing rule and remove the redundant width/max-width to avoid conflicts.

```css
/* Unified bubble sizing */
.chat-container > .message,
.chat-container > .loading {
  flex: 0 0 90%;
  max-width: 90%;
}

/* optional: let width be controlled by flex-basis only */
.chat-container > .message,
.chat-container > .loading {
  width: auto;
}
```

If you keep `width: 90%`, its OK, but then both should have **identical** rules:

```css
.chat-container > .message,
.chat-container > .loading {
  flex: 0 0 90%;
  width: 90%;
  max-width: 90%;
}
```

**Why this works:** in a flex container, `flex-basis` controls the items main size. The loading bubble now uses flex-basis, but `.message` is still sizing off `width`, which results in slightly different calculations.

Also ensure both are **direct children of `.chat-container`** so the same sizing context applies.

The container is shrinking because its being treated as a flex item with **no explicit width**, so its sizing to content. The fix is to **force it to stretch** to the parent width (same as hero panel).

Add this to your `.chat-container` rule (the last definition near lines ~1816+):

```css
.chat-container {
  width: 100%;
  max-width: 900px;
  align-self: stretch; /* overrides any parent align-items:center */
}
```

If its still shrinking, also make sure the parent (`main`) stretches its children:

```css
main {
  align-items: stretch;
}
```

That will make `.chat-container` behave like the hero panel: full width up to 900px, centered.
